pub struct Tokenizer<'a> {
    input: &'a String,
    input_size: usize,
    index: usize,
}

impl<'a> Tokenizer<'a> {
    pub fn new(input: &'a String) -> Tokenizer {
        Tokenizer {
            input: input,
            input_size: input.len(),
            index: 0
        }
    }
    
    fn is_token(&mut self, token: &str) -> bool {
        if (self.input_size - self.index) < token.len() {
            return false;
        }
        
        &self.input[self.index..] == token
    }
    
    pub fn parse(&mut self, output: &mut String) {
        let input_bytes = self.input.as_bytes();
        
        loop {
            if self.is_token("NaN") {
                output.push_str("[+[![]]]+[]+");
            } else if self.is_token("true") {
                output.push_str("[!![]]+[]+");
            } else if self.is_token("false") {
                output.push_str("[![]]+[]+");
            } else if self.is_token("Infinity") {
                output.push_str("[+(+!+[]+(!+[]+[])[!+[]+!+[]+!+[]]+[+!+[]]+[+[]]+[+[]]+[+[]])]+[]+");
            } else if self.is_token("undefined") {
                output.push_str("[[][[]]]+[]+");
            } else {
                transpile_byte(output, input_bytes[self.index]);
                self.index += 1;
            }
            
            if self.index >= self.input_size {
                output.pop();
                return;
            }
        }
    }
}